using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class WeldingInputModel : Notifier	{		public WeldingInputModel()		{					Shell = "";			NozzleAtShellRoof = "";			Nozzles = "";			RoofInsulationThickness = "";		}				private string _Shell;		public string Shell			{				get { return _Shell; }				set				{					_Shell = value;					OnPropertyChanged(nameof(Shell));				}			}				private string _NozzleAtShellRoof;		public string NozzleAtShellRoof			{				get { return _NozzleAtShellRoof; }				set				{					_NozzleAtShellRoof = value;					OnPropertyChanged(nameof(NozzleAtShellRoof));				}			}				private string _Nozzles;		public string Nozzles			{				get { return _Nozzles; }				set				{					_Nozzles = value;					OnPropertyChanged(nameof(Nozzles));				}			}				private string _RoofInsulationThickness;		public string RoofInsulationThickness			{				get { return _RoofInsulationThickness; }				set				{					_RoofInsulationThickness = value;					OnPropertyChanged(nameof(RoofInsulationThickness));				}			}			}}